  false,\n\t\"url\": null,\n\t\"notes\": \"This data set includes 31 georeferenced
  versions of original black and white aerial photographs acquired in digital form
  from the National Archives and Records Administration (NARA) for Monte Vista National
  Wildlife Refuge. These photo in this collection, from 1941, is one of the earliest
  know for this area and were part of the USDA's Agricultural Adjustment Administration's
  effort to capture the extent and condition of farmland across the US. Individual
  frames were referenced to the 2009 NAIP color imagery with ArcMap 10.0. The resolution
  of the image is 0.8 meters. This image should be used for resource-level interpretation
  only.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
